'use strict';(function(){const indexCfg={};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create(indexCfg);window.geekdocSearchIndex=index;index.add({'id':0,'href':'/docs/getting_started/subscribe-cvs/','title':"Subscribe to CVS",'content':"To subscribe to NetGain Cloud Vista SaaS, please contact assistance@netgain-systems.com\n"});index.add({'id':1,'href':'/docs/getting_started/','title':"Getting started",'content':""});index.add({'id':2,'href':'/docs/getting_started/install-emedge/','title':"Setting up EM Edge",'content':"This page tells you how to get started with setting up EM Edge agent at your local site.\n   Install requirements Installation steps Starting EM Edge     Install requirements EM Edge can run on Linux, Windows or Mac OS.\n For Linux, recommended OS is Centos 7/8 Recommended minimum specs: Intel i5 1.6MHz CPU, 8GB RAM, 50GB disk space  Installation steps  Install Java runtime from Java SE Development Kit 8 Downloads page Download and unzip the latest EM Edge software package  Starting EM Edge  Running EM Edge (OS dependent)  Windows: netgain/emedge.exe xx.xx.xx.xx Linux: netgain/emedge_linux xx.xx.xx.xx Mac: netgain/emedge_darwin xx.xx.xx.xx   Notes:  xx.xx.xx.xx points to Cloud Vista IP address/Domain name provided to you all logs will be saved in netagin/emedge.log file to enable auto start of EM Edge upon Linux reboot, add the following contents to /etc/rc.local path/to/netgain/emedge_linux xx.xx.xx.xx  to stop EM Edge, simply run same command with \u0026lsquo;stop\u0026rsquo; argument e.g. emedge_linux stop    "});index.add({'id':3,'href':'/docs/posts/','title':"News",'content':""});index.add({'id':4,'href':'/docs/categories/','title':"Categories",'content':""});index.add({'id':5,'href':'/docs/','title':"Home",'content':"-- Welcome to NetGain Docs website! About This Site This site hosts comprehensive information on NetGain products and solutions, as well as detailed technical information and tips to get your NetGain software up and running smoothly.\nFeedbacks Please contact support@netgain-systems.com to provide your valuable feedbacks.\n"});index.add({'id':6,'href':'/docs/tags/','title':"Tags",'content':""});})();